// src/features/auth/SignUp.jsx
import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import './Auth.css';

function normalizePhone(p) {
  // keep only digits; allow US 10–11 digits; you can expand this later
  return (p || '').replace(/\D+/g, '');
}
function normalizeEmail(e) {
  return (e || '').trim().toLowerCase();
}
function niceConflictMessage(errText = '') {
  const t = errText.toLowerCase();
  if (t.includes('email') && t.includes('already')) return 'That email is already registered.';
  if (t.includes('phone') && t.includes('already')) return 'That phone number is already registered.';
  // If the DB returns an index/constraint name, translate to a friendly message
  if (t.includes('stripecustomer') || t.includes('stripe_customer')) {
    return 'This Stripe customer is already linked. Try logging in.';
  }
  return 'Account already exists with these details.';
}

export default function SignUp() {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    phone: '',
    password: '',
  });
  const [loading, setLoading] = useState(false);
  const [err, setErr] = useState('');
  const navigate = useNavigate();

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((s) => ({ ...s, [name]: value }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (loading) return;

    setErr('');

    const payload = {
      name: formData.name.trim(),
      email: normalizeEmail(formData.email),
      phone: normalizePhone(formData.phone),
      password: formData.password, // hash happens server-side
    };

    // naive front-end checks
    if (!payload.name || !payload.email || !payload.phone || !payload.password) {
      setErr('Please fill out all fields.');
      return;
    }
    if (payload.password.length < 6) {
      setErr('Password must be at least 6 characters.');
      return;
    }
    if (payload.phone.length < 10) {
      setErr('Please enter a valid phone number.');
      return;
    }

    try {
      setLoading(true);
      const res = await fetch('/api/auth/register', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(payload),
      });

      // try to parse JSON either way
      let data = {};
      try { data = await res.json(); } catch { /* ignore */ }

      if (!res.ok) {
        if (res.status === 409) {
          // conflict (duplicate)
          const msg = data?.error || '';
          throw new Error(niceConflictMessage(msg));
        }
        throw new Error(data?.error || 'Registration failed');
      }

      // success: store token & go
      if (data?.token) localStorage.setItem('token', data.token);
      navigate('/dashboard');
    } catch (e) {
      console.error('Registration error:', e);
      setErr(e.message || 'Registration failed');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="auth-wrap">
      <form className="auth-card" onSubmit={handleSubmit} noValidate>
        <div className="auth-header">
          <div className="auth-logo">PF</div>
          <div className="auth-title">Create Your Account</div>
        </div>
        <div className="auth-sub">
          Join PeerFund and start lending or borrowing with your community.
        </div>

        <div className="auth-field">
          <label className="auth-label" htmlFor="name">Name</label>
          <input
            id="name"
            name="name"
            className="auth-input"
            type="text"
            autoComplete="name"
            value={formData.name}
            onChange={handleChange}
            required
          />
        </div>

        <div className="auth-field">
          <label className="auth-label" htmlFor="email">Email</label>
          <input
            id="email"
            name="email"
            className="auth-input"
            type="email"
            autoComplete="email"
            value={formData.email}
            onChange={handleChange}
            required
          />
        </div>

        <div className="auth-field">
          <label className="auth-label" htmlFor="phone">Phone</label>
          <input
            id="phone"
            name="phone"
            className="auth-input"
            type="tel"
            autoComplete="tel"
            value={formData.phone}
            onChange={handleChange}
            required
          />
        </div>

        <div className="auth-field">
          <label className="auth-label" htmlFor="password">Password</label>
          <input
            id="password"
            name="password"
            className="auth-input"
            type="password"
            autoComplete="new-password"
            value={formData.password}
            onChange={handleChange}
            required
            minLength={6}
          />
        </div>

        {err && <div className="auth-error">{err}</div>}

        <div className="auth-actions">
          <button className="auth-btn primary" type="submit" disabled={loading}>
            {loading ? 'Registering…' : 'Sign Up'}
          </button>
          <Link className="auth-btn ghost" to="/login">Already have an account?</Link>
        </div>

        <div className="auth-footer">
          <button type="button" className="auth-link" onClick={() => navigate('/')}>
            ← Back to Home
          </button>
        </div>
      </form>
    </div>
  );
}
